import React, { Fragment } from 'react';
const ResumenProducto = (cantidad, producto) => {

    return ( 
        <Fragment>
            <div className="border mb-4 p-4">
                <p className="card-text font-weight-bold">
                Nombre del Producto:
                    <span>{producto.nombre}</span>    
                </p>    
            </div>
        </Fragment>
     );
}
 
export default ResumenProducto;
